function setSuggestErrors(setError,message,urlInput,input){if(setError){urlInput.closest('div.form-group').addClass('has-error');input.closest('div.form-group').addClass('has-error');urlInput.closest('div.form-group').find('.help-block').html(message).show();input.closest('div.form-group').find('.help-block').html(message).show();}else{urlInput.closest('div.form-group').removeClass('has-error');input.closest('div.form-group').removeClass('has-error');urlInput.closest('div.form-group').find('.help-block').hide();input.closest('div.form-group').find('.help-block').hide();}}